{
  "type": "object",
  "properties": {
    "leadCategory": {
      "type": "string",
      "enum": ["Hot Lead", "Warm Lead", "Cold Lead", "Special Case"]
    },
    "salesTeam": {
      "type": "string",
      "enum": ["Immediate Consultation Team", "Nurture Team", "Requalification Team", "Customer Service  Callback"]
    },
    "rationale": {
      "type": "string"
    },
    "callbackEvent": {
      "type": ["string", "null"],
      "format": "date-time"
    }
  },
  "required": ["leadCategory", "salesTeam", "rationale", "callbackEvent"],
  "additionalProperties": false
}
